<template>
  <div class="row">
    <div class="col col-md-3" >
      
      <q-tree
        :nodes="nodeTree"
        v-model:selected="selected"
        v-model:ticked="ticked"
        v-model:expanded="expanded"
        node-key="key"
      />

    </div>
    <div class="col col-md-9" v-show="blankForm" style="height: 700px;">
      <div ref="pdfView" id="pdfView"></div>
    </div>
   
    <div class="col col-md-9" :class="selectLoading ? 'flex-center':''" v-if="!blankForm" style="height: 700px;">
      <div v-show="isViewAll" class="row">
        <div class="col col-md-11">
          <q-input 
            bottom-slots 
            v-model="patientSearch" 
            label="Search Patient"
            dense 
          >
            <template v-slot:before>
              <q-icon name="personal_injury" />
            </template>

            <template v-slot:append>
              <q-icon v-if="patientSearch !== ''" name="close" @click="patientSearch = ''" class="cursor-pointer" />
              <q-icon name="search" />
            </template>
          </q-input>
        </div>
        <div class="col col-md-11 text-center q-mt-lg" v-show="selectLoading" style="height: 700px;">
          <q-spinner-hourglass color="primary" size="3em" />
        </div>
        <div class="col col-md-11  text-center q-mt-lg" v-show="!selectLoading && !isSpecFolders && filterPatients.length === 0" style="height: 700px;">
          <q-icon name="sentiment_dissatisfied" style="color: #ccc; font-size: 6.4em;" /> <br>
          No Data Found
        </div>
        <div class="col col-md-11">
          <q-list v-if="!isSpecFolders">
            <q-item
              v-for="(el, key) in filterPatients"
              :key="key"
              clickable 
              v-ripple
              @click="getPatientDetails(el.key)"
            >
              <q-item-section avatar>
                <q-icon color="negative" name="description" />
              </q-item-section>

              <q-item-section>
                <q-item-label>{{ el.name }}</q-item-label>
                <q-item-label caption lines="2">{{ getSpecialities(el.specialities) }}</q-item-label>
              </q-item-section>

              <q-item-section side top>
                <q-item-label caption>{{el.createdDate}}</q-item-label>
              </q-item-section>
            </q-item>
          </q-list>
          <q-list v-if="isSpecFolders">
            <q-item
              v-for="(el, key) in speciality"
              :key="key"
              clickable 
              v-ripple
              @click="getSpecialityDetails(el)"
            >
              <q-item-section avatar>
                <q-icon color="primary" name="folder" />
              </q-item-section>

              <q-item-section>
                <q-item-label>{{ el }}</q-item-label>
              </q-item-section>
            </q-item>
          </q-list>
        </div>
      </div>
      <!-- for print data -->
      <iframe v-show="!selectLoading && !isViewAll" id="pdf" style="width: 100%; height: 100%; border: none;"></iframe>
    </div>
    
  </div>
</template>

<script>
import { LocalStorage, SessionStorage } from 'quasar'
import { PDFDocument, StandardFonts, rgb } from 'pdf-lib'
import jwt_decode from 'jwt-decode'
import { api } from 'boot/axios'
import { defineComponent } from 'vue';

export default defineComponent({
  components: {
    // VuePdfApp
  },
  data(){
    return {
      selected: 'blank',
      ticked: null,
      expanded: ['memoFolder'],
      blankForm: true,
      isSpecFolders: false,
      selectLoading: true,
      isViewAll: false,
      patientSearch: '',
      allPatientList: [],
      pdfFile: "files/memo_template.pdf",
      speciality: ["GS", "TRAUMA", "HEAD & NECK", "BREAST", "HBT", "COLORECTAL", "MIS", "UROLOGY", "NEURO", "PLASTICS", "PEDIA", "TCVS"],
    }
  },
  watch:{
    selected(newVal){
      if(newVal == 'blank' || newVal == 'memoFolder'){
        this.blankForm = true;
      } else {
        this.blankForm = false;
        if(newVal == 'patientFolder'){
          this.isSpecFolders = false;
          this.getList();
        } else if(newVal == 'specialityFolder'){
          this.selectLoading = false;
          this.isSpecFolders = true;
          this.isViewAll = true;
        } else if(this.speciality.includes(newVal)){
          this.getSpecialityDetails(newVal);
        } else {
          this.isSpecFolders = false;
          this.getPatientDetails(newVal);
        }
      }
    },
  },
  mounted(){
    this.previewMemo().then(() => {
      this.getListPrint();
    });
  },
  computed:{
    user: function(){
      let profile = LocalStorage.getItem('userData');
      return jwt_decode(profile);
    },
    filterPatients: function(){
      return this.allPatientList.filter(patient => {

          return patient.name.toLowerCase().includes(this.patientSearch.toLowerCase())
          
      })
    },
    nodeTree: function(){
      return [
        {
          label: 'Surgery Memo',
          icon: 'folder',
          key: 'memoFolder',
          children: [
            {
              label: 'Blank Form',
              icon: 'picture_as_pdf',
              key: 'blank',
            },
          ]
        },
        {
          label: 'Specialities',
          icon: 'folder',
          key: 'specialityFolder',
          children: [
            {
              label: 'GS',
              icon: 'folder',
              key: 'GS',
            },
            {
              label: 'TRAUMA',
              icon: 'folder',
              key: 'TRAUMA',
            },
            {
              label: 'HEAD & NECK',
              icon: 'folder',
              key: 'HEAD & NECK',
            },
            {
              label: 'BREAST',
              icon: 'folder',
              key: 'BREAST',
            },
            {
              label: 'HBT',
              icon: 'folder',
              key: 'HBT',
            },
            {
              label: 'COLORECTAL',
              icon: 'folder',
              key: 'COLORECTAL',
            },
            {
              label: 'MIS',
              icon: 'folder',
              key: 'MIS',
            },
            {
              label: 'UROLOGY',
              icon: 'folder',
              key: 'UROLOGY',
            },
            {
              label: 'NEURO',
              icon: 'folder',
              key: 'NEURO',
            },
            {
              label: 'PLASTICS',
              icon: 'folder',
              key: 'PLASTICS',
            },
            {
              label: 'PEDIA',
              icon: 'folder',
              key: 'PEDIA',
            },
            {
              label: 'TCVS',
              icon: 'folder',
              key: 'TCVS',
            },
          ]
        },
        {
          label: 'Patients Folder',
          icon: 'folder',
          key: 'patientFolder',
        }
        
      ]
    }
  },
  methods:{
    getSpecialities(spec){
      let data = JSON.parse(spec)
      return data.join(', ')
    },
    async getListPrint(){
      let vm = this;
      
      let payload = {
        user: this.user.userId,
        userType: this.user.userType
      }
      api.post('app/getPrintPatientList', payload).then((response) => {
          const data = {...response.data};
          if(!data.error){
            let chilTreeNode = [];
            if(response.status < 300){
              data.list.forEach((el, key) => {
                chilTreeNode.push({
                  label: el.name,
                  icon: 'face',
                  key: el.key,
                });
              });
            }

            this.nodeTree[2].children = chilTreeNode;
          } else {
              this.$q.notify({
                  color: 'negative',
                  position: 'top-right',
                  title:data.title,
                  message: this.$t(`errors.${data.error}`),
                  icon: 'report_problem'
              })
          }
      })
    },
    async getList(){
      this.selectLoading = true;
      let vm = this;
      
      let payload = {
        user: this.user.userId,
        userType: this.user.userType
      }
      api.post('app/getPatientList', payload).then((response) => {
          const data = {...response.data};
          if(!data.error){
            this.allPatientList = data.list;
            // let chilTreeNode = [];
            // if(response.status < 300){
            //   data.list.forEach((el, key) => {
            //     chilTreeNode.push({
            //       label: el.name,
            //       icon: 'face',
            //       key: el.key,
            //     });
            //   });
            // }

            // this.nodeTree[1].children = chilTreeNode;
            this.isViewAll = true;
            this.selectLoading = false;
          } else {
              this.$q.notify({
                  color: 'negative',
                  position: 'top-right',
                  title:data.title,
                  message: this.$t(`errors.${data.error}`),
                  icon: 'report_problem'
              })
          }
      })
    },
    async previewMemo(){
      // const fileUrl = "";
      const fileUrl = "";
 
      let container = document.getElementById('pdfView');
      let doc = document.createElement('object');
      doc.data = `data:application/pdf;base64,${fileUrl}`;
      doc.type = "application/pdf";
      doc.width = "100%";
      doc.height = "100%";

      container.appendChild(doc)
    },
    async getPatientDetails(id){
      this.selectLoading = true;
      this.isViewAll = false;
      let vm = this;
      if(id == 'patientFolder' || id == null){
        this.isViewAll = true;
        this.selectLoading = false;
        return false;
      }

      await api.get(`app/getDetails/${id}`).then((response) => {
          const data = {...response.data};
          if(!data.error){
            this.generateMemo(data)
          } else {
              this.$q.notify({
                  color: 'negative',
                  position: 'top-right',
                  title:data.title,
                  message: this.$t(`errors.${data.error}`),
                  icon: 'report_problem'
              })

            this.selectLoading = false;
          }
      })
    },
    async getSpecialityDetails(id){
      this.selectLoading = true;
      this.isViewAll = false;
      this.isSpecFolders = false;
      let vm = this;
      if(id == 'specialityFolder' || id == null){
        this.isViewAll = true;
        this.selectLoading = false;
        return false;
      }

      await api.get(`app/getSpecialities/${id}`).then((response) => {
          const data = {...response.data};
          if(!data.error){
            this.allPatientList = data.list;
            this.isViewAll = true;
            this.selectLoading = false;
          } else {
            this.$q.notify({
                color: 'negative',
                position: 'top-right',
                title:data.title,
                message: this.$t(`errors.${data.error}`),
                icon: 'report_problem'
            })
          }
      }).catch(error => {
        this.selectLoading = false;
        return;
      })
    },
    async generateMemo(data){
      let payload = {
        patientId: data.id 
      };

      await api.post(`download/patient/memoLink`, payload).then((response) => {
          const data = {...response.data};
          if(!data.error){
            const link = document.createElement('a');
            link.id = "downloadResult";
            link.href = data.urlLink;
            link.target = "_blank";

            link.click();
            this.isViewAll = true;
            this.selectLoading = false;
          } else {
              this.$q.notify({
                  color: 'negative',
                  position: 'top-right',
                  title:data.title,
                  message: this.$t(`errors.${data.error}`),
                  icon: 'report_problem'
              })
          }
      })
    }


  }
})
</script>

<style scoped>
#pdfView{
    /* position: absolute; */
    border: 1px solid black;
    display: block;
    left: 17.5%;
    right: 0%;
    height: 100%;
}
.example-item {
  height: auto;
  width: 110px;
}
  
</style>
